import React from "react";
import { DefaultInput, Form, InlineForm, InputSeparator, Button } from "../form/inputs";
import Image from "./image";
import styled from "styled-components";


const ContentWrapper = styled("div")`
  display: grid;
  grid-template-columns: 455px 60%;


`;

const FormContainer = styled(Form)`
  padding: 0px 20px;
  position: relative;


`;
const CenteredForm = styled("div")`

  margin: 0;
  position: absolute;
  top: 50%;
  left: 50%;
  -ms-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);

`;

const Login = () => {
  return (
    <>
    <ContentWrapper>
    <Image/>
      <FormContainer>
          <CenteredForm></CenteredForm>
        <DefaultInput
          placeholder="Enter pickup location"
          id="location"
        />
        <DefaultInput
          placeholder="Enter drop off for estimate"
          id="dropoff"
        />
        <InlineForm>
          <DefaultInput
            placeholder="Today"
            id="date"
          />
          <InputSeparator>
            <DefaultInput placeholder="06:45 AM" id="time" />
          </InputSeparator>
        </InlineForm>
        <Button>Next</Button>
      </FormContainer>
      </ContentWrapper>
    </>
  );
};

export default Login;
